import React from 'react';
import Book from './book';

class BookDetails extends React.Component{

    render(){
        return this.props.myBookDetails.map((bookDetails)=>{
            //console.log({bookDetails});
            return <BookDetails key={bookDetails._id} bookDetails={bookDetails} 
            ReloadDataMethod={this.props.ReloadDataMethod}></BookDetails>
        });
    }
}
export default BookDetails;
